import React from 'react'
import styled from "styled-components"

const Header = () => {

const HeaderWrapper = styled.header`
    width: 100vw;
    height: 4rem;
    background-color: black;
    color: white;
    padding: 0
    display: flex;
    flex-direction: row;
    justify-content: space-between;
`

  return (
    <HeaderWrapper>
        <div>
            Logo
        </div>
        <div>
            Navigation
        </div>
    </HeaderWrapper>
  )
}

export default Header
